function Header() {
    return (
        <div className="header">
            <img src="img/wallpaperit-Logo.png" className="header-logo" alt="Wallpaperit Logo" />
            <div className="header-icons">
                <a href="">
                    <img src="img/sign in.png">Sign in</img>
                </a>
                <a href="">
                    <img src="img/wishlist.png">Wishlist</img>
                </a>
                <a href="">
                    <img src="img/bag.png">Bag</img>
                </a>
            </div>
        </div>
    );
}

export default Header;
